INSERT INTO `catalog_category_entity_text` VALUES (1,3,65,0,1,NULL),(2,3,65,1,1,NULL),(3,3,65,0,2,NULL),(4,3,65,1,2,NULL),(5,3,44,0,3,NULL),(6,3,47,0,3,NULL),(7,3,48,0,3,NULL),(8,3,62,0,3,NULL),(9,3,65,0,3,NULL),(10,3,44,0,4,'<div class=\"catgory-top-two\">\r\n<h5>TIMELESS - FOR ALL TIME</h5>\r\n<h2>THE OYSTER PERPETUAL</h2>\r\n<div class=\"home-top-one-content\">The aesthetics of the Rolex Oyster Perpetual models set them apart as symbols of universal and classic style. They embody timeless form and function, firmly rooted in the pioneering origins of Rolex. The simplicity of an original.</div>\r\n</div>'),(11,3,47,0,4,NULL),(12,3,48,0,4,NULL),(13,3,62,0,4,NULL),(14,3,65,0,4,NULL),(15,3,44,0,5,NULL),(16,3,47,0,5,NULL),(17,3,48,0,5,NULL),(18,3,62,0,5,NULL),(19,3,65,0,5,NULL),(25,3,44,0,6,NULL),(26,3,47,0,6,NULL),(27,3,48,0,6,NULL),(28,3,62,0,6,NULL),(29,3,65,0,6,NULL),(30,3,44,0,7,NULL),(31,3,47,0,7,NULL),(32,3,48,0,7,NULL),(33,3,62,0,7,NULL),(34,3,65,0,7,NULL),(35,3,44,0,8,'<div class=\"catgory-top-two\">\r\n<h5>BASELWORLD 2017</h5>\r\n<h2>ROLEX NEW  WATCHES</h2>\r\n<div class=\"home-top-one-content\">Rolex is introducing the latest creations in its Oyster and Cellini collections. Like all Rolex timepiecies, the new watches are covered by Rolex\'s own Superlative Chronometer certification - symbolized by the green seal - guranteering that they satisfy performance criteria which exceed watchmaking norms and standards in terms of percision, power reserve, waterproofness and self-winding. The certification is coupled with an international five-year guarantee.</div>\r\n</div>'),(36,3,47,0,8,NULL),(37,3,48,0,8,NULL),(38,3,62,0,8,NULL),(39,3,65,0,8,NULL),(40,3,44,0,9,NULL),(41,3,47,0,9,NULL),(42,3,48,0,9,NULL),(43,3,62,0,9,NULL),(44,3,65,0,9,NULL),(59,3,44,0,10,'<div class=\"catgory-top-two\">\r\n<h5>THE ARCHETYPE OF THE DIVER\'S WATCH</h5>\r\n<h2>THE  ROLEX SUBMARINER</h2>\r\n<div class=\"home-top-one-content\">The Rolex Submariner\'s robust and functional design swiftly became iconic.With their subtly redesigned Oyster case,distinctive dial with large luminescent hour makers,graduated rotable Cerachrom bezel and solid link Oyster bracelet,the latest generation Submariner and Submariner Date are firmly in line with the original model laumched in 1953.</div>\r\n</div>'),(60,3,47,0,10,NULL),(61,3,48,0,10,NULL),(62,3,62,0,10,NULL),(63,3,65,0,10,NULL),(99,3,44,0,11,'<div class=\"catgory-top-two\">\r\n<h5>THE ULTIMATE CHRONOGRAPH</h5>\r\n<h2>The Cosmograph Daytona</h2>\r\n<div class=\"home-top-one-content\">The Rolex Cosmograph Daytona, introduced in 1963, Was designed to meet the the demands of professional racing drivers. With its highly reliable chronograph and bezel with tachymetric scale, it allows drivers to measure average speeds uo to 400 kilometres or miles per hour. An icon eternally joined in name and function to the high-performance world of motor sport.</div>\r\n</div>'),(100,3,47,0,11,NULL),(101,3,48,0,11,NULL),(102,3,62,0,11,NULL),(103,3,65,0,11,NULL),(127,3,44,0,12,'<div class=\"catgory-top-two\">\r\n<h5>THE CLASSICAL WATCH BY ROLEX</h5>\r\n<h2>CELLINI COLLECTION</h2>\r\n<div class=\"home-top-one-content\">The Cellini collection is a contemporary celebration of classicism and the eternal elegance of traditional timepieces, combing the best of Rolex know how and its high standars of perfection with an approach that heightens watchmaking heritage  in its most timeless form.</div>\r\n</div>'),(128,3,47,0,12,NULL),(129,3,48,0,12,NULL),(130,3,62,0,12,NULL),(131,3,65,0,12,NULL),(132,3,44,0,13,NULL),(133,3,47,0,13,NULL),(134,3,48,0,13,NULL),(135,3,62,0,13,NULL),(136,3,65,0,13,NULL),(165,3,44,0,14,NULL),(166,3,47,0,14,NULL),(167,3,48,0,14,NULL),(168,3,62,0,14,NULL),(169,3,65,0,14,NULL),(170,3,44,0,15,'<div class=\"catgory-top-two\">\r\n<h5>TIMELESS - FOR ALL TIME</h5>\r\n<h2>THE OYSTER PERPETUAL</h2>\r\n<div class=\"home-top-one-content\">The aesthetics of the Rolex Oyster Perpetual models set them apart as symbols of universal and classic style. They embody timeless form and function, firmly rooted in the pioneering origins of Rolex. The simplicity of an original.</div>\r\n</div>'),(171,3,47,0,15,NULL),(172,3,48,0,15,NULL),(173,3,62,0,15,NULL),(174,3,65,0,15,NULL),(205,3,44,0,16,'<div class=\"catgory-top-two\">\r\n<h5>IRRESISTIBLE CHARM</h5>\r\n<h2>THE PEARLMASTER</h2>\r\n<div class=\"home-top-one-content\">The Rolex Pearlmaster is Rolex’s crowning jewellery watch. Featuring the softly curved lines of the Pearlmaster design, it is characterised by uniquely rich dials and exquisite gem settings of diamonds, sapphires or rubies and available only in 18 ct yellow, white or Everose gold made by Rolex in its own foundry.</div>\r\n</div>'),(206,3,47,0,16,NULL),(207,3,48,0,16,NULL),(208,3,62,0,16,NULL),(209,3,65,0,16,NULL),(215,3,44,0,17,'<div class=\"catgory-top-two\">\r\n<h5>THE ARCHETYPE OF THE MODERN WATCH</h5>\r\n<h2>THE DATEJUST</h2>\r\n<div class=\"home-top-one-content\">The classic Rolex Datejust is the archetype of the modern watch, thanks to aesthetics and functions that transcend changes in fashion. Aesthetically, the Datejust has spanned eras, while retaining the enduring codes that make it one of the most recognised and recognisable of watches.</div>\r\n</div>'),(216,3,47,0,17,NULL),(217,3,48,0,17,NULL),(218,3,62,0,17,NULL),(219,3,65,0,17,NULL),(230,3,44,0,19,'<div class=\"catgory-top-two\">\r\n<h5>PRECIOUS MATERIALS</h5>\r\n<h2>THE DAY-DATE</h2>\r\n<div class=\"home-top-one-content\">The Rolex Day-Date made its debut in 1956. Available only in 18 ct gold or platinum, it was the first wristwatch chronometer to display the date and the day of the week spelt out in full in  windows on the dial. With the President bracelet, originally created specially for it, the Day-Date continues to be the watch par excellence of influential people.</div>\r\n</div>'),(231,3,47,0,19,NULL),(232,3,48,0,19,NULL),(233,3,62,0,19,NULL),(234,3,65,0,19,NULL),(235,3,44,0,20,'<div class=\"catgory-top-two\">\r\n<h5>SIMPLICITY IS THE ULTIMATE SOPHISTICATION</h5>\r\n<h2>THE ROLEX SKY-DWELLER</h2>\r\n<div class=\"home-top-one-content\">A distinctive technological masterpiece protected by 11 to 14 patents depending on the model, the Rolex Sky-Dweller provides the information global travellers need to keep track of time at a glance. Launched in 2012, the Sky-Dweller is a compelling timepiece of revolutionary design that blends to perfection mechanical sophistication and ease of use.</div>\r\n</div>'),(236,3,47,0,20,NULL),(237,3,48,0,20,NULL),(238,3,62,0,20,NULL),(239,3,65,0,20,NULL),(245,3,44,0,21,'<div class=\"catgory-top-two\">\r\n<h5>THE PILOT’S WATCH</h5>\r\n<h2>THE GMT-MASTER II</h2>\r\n<div class=\"home-top-one-content\">The GMT-Master, introduced in 1955, was developed to meet the needs of intercontinental airline pilots, and proved invaluable to those whose professions involve long-distance travel. Featuring a rotatable 24-hour graduated bezel and a separate 24-hour hand, it allows those who travel the world to read two different time zones simultaneously, and up to three by turning the rotatable bezel.</div>\r\n</div>'),(246,3,47,0,21,NULL),(247,3,48,0,21,NULL),(248,3,62,0,21,NULL),(249,3,65,0,21,NULL),(259,3,44,0,22,'<div class=\"catgory-top-two\">\r\n<h5>A HOMMAGE TO AVIATION</h5>\r\n<h2>THE AIR-KING</h2>\r\n<div class=\"home-top-one-content\">The Rolex Air-King pays tribute to the pioneers of flight and the Oyster’s role in the epic story of aviation. With its 40mm case in 904L steel, solid-link Oyster bracelet with Oysterclasp, and distinctive black dial, the new Air-King is as functional as it is timeless. Updated for the modern wearer but keeping with the aesthetics of the 1950s model, the new Oyster Perpetual Air-King perpetuates the aeronautical heritage of the original Rolex Oyster.</div>\r\n</div>'),(260,3,47,0,22,NULL),(261,3,48,0,22,NULL),(262,3,62,0,22,NULL),(263,3,65,0,22,NULL),(273,3,44,0,23,'<div class=\"catgory-top-two\">\r\n<h5>AN ICONIC HIGH-ALTITUDE COMPANION</h5>\r\n<h2>THE ROLEX EXPLORER</h2>\r\n<div class=\"home-top-one-content\">Launched in 1953 as the ultimate expedition and mountaineering watch, the Explorer draws on decades of experience of Rolex in the Himalayas. It is designed for optimal legibility even in the dark – a crucial feature for explores. The Rolex Explorer II, first released in 1971, is the natural heir to the original Rolex Explorer - yet with a character all of its own. A robust, highly refined tool watch, the Explorer II swiftly became the watch of choice of speleologists, volcanologists and polar and jungle explorers, thanks to its specially designed features.</div>\r\n</div>'),(274,3,47,0,23,NULL),(275,3,48,0,23,NULL),(276,3,62,0,23,NULL),(277,3,65,0,23,NULL),(295,3,44,0,24,'<div class=\"catgory-top-two\">\r\n<h5>THE SCIENTIST’S WATCH</h5>\r\n<h2>THE MILGAUSS</h2>\r\n<div class=\"home-top-one-content\">The reliability and precision of an ordinary mechanical watch can be affected by a magnetic field of 50 to 100 gauss. But many scientists are exposed to much higher magnetic fields during the course of their work. Rolex’s solution was the Rolex Milgauss, created in 1956, and resistant to 1000 gauss. Hence the name of the watch, mille being French for thousand.</div>\r\n</div>'),(296,3,47,0,24,NULL),(297,3,48,0,24,NULL),(298,3,62,0,24,NULL),(299,3,65,0,24,NULL),(305,3,44,0,25,'<div class=\"catgory-top-two\">\r\n<h5>THE WATCH OF THE OPEN SEAS</h5>\r\n<h2>THE ROLEX YACHT-MASTER</h2>\r\n<div class=\"home-top-one-content\">The Rolex Yacht-Master and Yacht-Master II embody the spirit of the sailor, pairing scrupulously selected materials for high performance with impeccable aesthetics. Inspired by the rich heritage that has bound Rolex to the world of sailing since the 1950s, the Yacht-Master blends function and style, while the Yacht-Master II brings together the finest in Rolex technology to create a regatta chronograph built for yachting competition.</div>\r\n</div>'),(306,3,47,0,25,NULL),(307,3,48,0,25,NULL),(308,3,62,0,25,NULL),(309,3,65,0,25,NULL),(315,3,44,0,26,'<div class=\"catgory-top-two\">\r\n<h5>HOW ROLEX CONQUERED THE DEEP</h5>\r\n<h2>THE ROLEX SEA-DWELLER</h2>\r\n<div class=\"home-top-one-content\">The ultra-resistant divers’ models engineered by Rolex for the conquest of the deep: waterproof to a depth of 4,000 feet (1,220 metres) for the Rolex Sea-Dweller and 12,800 feet (3,900 meters) for the Rolex Deepsea, they are the result of decades of collaboration with diving professionals.</div>\r\n</div>'),(316,3,47,0,26,NULL),(317,3,48,0,26,NULL),(318,3,62,0,26,NULL),(319,3,65,0,26,NULL);
