07-06 12:28:01','2017-07-06 12:28:01',1),(7,'Footer Middle','footer-middle','<div class=\"fooler-logo-img\"><a href=\"{{store url=\"\"}}\"><img alt=\"\" src=\"{{media url=\"wysiwyg/logo3.png\"}}\" /></a></div>\r\n<div class=\"footer-middle-menu\">\r\n<ul>\r\n<li><a href=\"{{store url=\"rolex/rolex-royal-de-versailles.html\"}}\">ROLEX AT ROYAL DE VERSAILLES</a></li>\r\n<li><a href=\"{{store url=\"rolex/the-rolex-watches.html\"}}\">THE ROLEX WATCHES</a></li>\r\n<li><a href=\"{{store url=\"rolex/new-2017-watches.html\"}}\">NEW 2017 WATCHES</a></li>\r\n<li><a href=\"{{store url=\"contact-us\"}}\">CONTACT US</a></li>\r\n</ul>\r\n</div>','2017-07-06 13:11:19','2017-07-17 13:01:30',1),(8,'menu under logo','menu-under-logo','<ul class=\"nav-primary-bottom\">\r\n<li class=\"level0 nav-1 first\"><a class=\"level0 \" href=\"{{store url=\"rolex/rolex-royal-de-versailles.html\"}}\">Rolex At Royal DE Versailles</a></li>\r\n<li class=\"level0 nav-1 first\"><a class=\"level0 \" href=\"{{store url=\"rolex/the-rolex-watches.html\"}}\">The Rolex Watches</a></li>\r\n<li class=\"level0 nav-1 first\"><a class=\"level0 \" href=\"{{store url=\"rolex/new-2017-watches.html\"}}\">New 2017 Watches</a></li>\r\n<li class=\"level0 nav-1 first\"><a class=\"level0 \" href=\"{{store url=\"contact-us\"}}\">Contact Us</a></li>\r\n</ul>','2017-07-07 06:12:33','2017-07-17 12:58:13',1),(9,'small logo text','small-logo-text','<a class=\"logo-sec\" href=\"{{store url=\"\"}}\"><img alt=\"\" src=\"{{media url=\"wysiwyg/logo-sec2.png\"}}\" /></a>','2017-07-07 06:15:28','2017-07-17 15:16:20',1),(11,'The Submariner collection','submariner-collection','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/RAH-FoIhtkE\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE ROLEX SUBMARINER</h5>\r\n<h2>AT HOME IN THE<br />OCEANS</h2>\r\n<p>The Oyster Perpetual Submariner is the quintessential divers\'watch,the benchmark in its genre.This iconic timepiece has evolved with a series of patented Rolex technical innovations,guaranteeing its reliability and precision down to depths of 300 metres(1,000feet).</p>\r\n<p>At home in the oceans,where it remains an indispensable instrument for every diver, the Submariner has also conquered terra firma as the watch of action with a rugged elegance of its own.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/submariner_feature_img1_570x500_1.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SUBMARINER</h5>\r\n<h2>UNIDIRECTIONAL<br />ROTATABLE BEZEL</h2>\r\n<p>The Submariner\'s rotatable bezel is a key functionality of the watch.its engraved 60-minute graduations allow a driver to accuratly and safely monitor diving time and decompression stops.Manufactured by Rolex from hard,corrosion-resistant ceramic,the Cerachrom bezel insurt is virtually scratchproof.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/submariner_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SUBMARINER</h5>\r\n<h2>BLUE LUMINESCENCE</h2>\r\n<p>The Chromalight display on the dial is an innovation that pushes the boundries of visibility in dark environments.The blue glow lasts up to eight hours with a uniform luminosity throughout,practically twice as long as that of standard luminescent materials.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/submariner_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SUBMARINER</h5>\r\n<h2>TRIPLOCK WINDING<br />CROWN</h2>\r\n<p>The Triplock winding crown is a triple waterproofness system designed especially for diver\'s watches.Developed by Rolex,resists water pressure to depths of 300 metres,and up 3,900 metres(12,800 feet) on the Rolex Deepsea.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />SUBMARINER</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">Contact Us</a></div>\r\n</div>\r\n</div>','2017-07-08 07:07:36','2017-07-13 10:07:03',1),(12,'The Cosmograph Daytona collection','the-cosmograph-daytona-collection','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/k61_DT0cQgo\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE DAYTONA</h5>\r\n<h2>PERFECT ALCHEMY OF<br />FORM AND FUNCTION</h2>\r\n<p>Efficient, precise, legible, robust, reliable, waterproof and self-winding, the Cosmograph Daytona is also comfortable,elegant and timeless. Judging by the success and outstanding reputation worldwide of this perfect alchemy of form and funtion, it is considered in many respects to be the etilmate chronograph.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/daytona_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAYTONA</h5>\r\n<h2>STRAT, STOP, RESET</h2>\r\n<p>The Daytona\'s chronograph functions are activated by pushers that screw down like the winding crown when they are not in use, guaranteening waterproofness to 100 metres.One press to start, stop or reset the chronograph produces a crisp, clear click that was perfected using the most advanced technology. Rolex watchmakers also perfected the mechanism to suit the ideal finger pressure on the pushers, and engineered it to provide an instantaneous and accurate start to the timing without sacrificing reliability.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/daytona_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAYTONA</h5>\r\n<h2>PERPETUAL<br />CALIBRE 4130</h2>\r\n<p>Calibre 4130\'s performance stems particularly from the use of a vertical - instead of lateral - clutch to activate the chronograph. The solution functions on the principles of two discs, One above the other, which work together by direct friction contact and offer signifcant advantage - extremely precise starting and stopping of the perfectly smooth running chronograph seconds hand as soon as the pusher is pressed; and the capacity of the chronograph to function for long periods of time with no negative impact on the precision of the watch.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/daytona_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAYTONA</h5>\r\n<h2>MONOBLOC<br />CERACHROM BEZEL</h2>\r\n<p>The monobloc Cerachrom bezel in high-tech ceramic offers a number of advantages: it is corrosion resistant, virtually scratchproof and the colour is unaffected by UV rays. The extremely durable bezel also offers an expectionally legible tachymetric scale, thanks to the deposition of a thin later of platinum in the numerals and graduation via a PVD (Physical Vapour Deposition) process. The monobloc Cerachrom bezel is made in a single piece and holds the crystal firmly in place on the middle case, ensuring waterproofness.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />COSMOGRAPH DAYTONA</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">Contact Us</a></div>\r\n</div>\r\n</div>','2017-07-08 07:52:24','2017-07-13 10:02:32',1),(13,'The Cellini collection','thecellini-collection','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/pMKqLTH_iis\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE CELLINI COLLECTION</h5>\r\n<h2>ELEGANCE AND<br />NOBILITY</h2>\r\n<p>The lines are sober and refined, the materials noble, the finishings luxurious: every detailrespects the codes of the aret of watchmaking, marking a return to the sources of classicism reinterpreted in perfect harmony with its time. Faceted and shaped like a two-edged sword, the hands count off each second, each minute and each hour with the full precision of the self-winding chronometer movement at the heart of this prestigious timepiece.</p>\r\n</div>\r\n</div>\r\n<div class=\"cellini-cnt-middle\">\r\n<div class=\"cellini-cnt-middle-inner\">\r\n<div class=\"catgory-top-two\">\r\n<h5>POETRY IN THE LUNAR CYCLE</h5>\r\n<h2>CELLINI MOONPHASE</h2>\r\n<div class=\"home-top-one-content\">Rolex is introducing a new model in its Cellini collection, the Cellini Moonphase, featuring an exclusive display of the lunar cycle. The 39 mm Cellini Moonphase is offered in 18 ct Everose gold. The Cellini Moonphase has a white lacquer dial with a blue enamelled disc at 6 o\'clock showing the full moon and the new moon, the former depicted by a meteorite applique and the latter by a silver ring. The moonphase is read via the indicator set at 12 o\'clock on the subdial, as the full moon and new moon rotate through the lunar cycle. The Cellini Moonphase also displays the date around the circumference of the dial, Via a centre hand with a crescent moon at its tip. This new models is driven by a self-winding mechanical movement entirely manaufactured by Rolex, Whose patented moonphase module is astronomically accurate for 122 years. The Cellini Moonphase is fitted on a brown alligator leather strap with a folding Crownclasp in 18 ct Everose gold, a first for a Cellini model.</div>\r\n<div class=\"cellini-cnt-inner-img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/cellini_mosaic_image_1023x690.jpg\"}}\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"cellini-cnt-bottom\"><img alt=\"\" src=\"{{media url=\"wysiwyg/cellini_banner_img2_1680x420.jpg\"}}\" /></div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/cellini_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>THE ESSENCE OF A TIMELESS CLASSIC</h5>\r\n<h2>CELLINI TIME</h2>\r\n<p>Hours, minutes and seconds form the essence of everyday timekeeping. The Rolex Cellini Time captures the present as if nothing else were of importance; nothing but the magic of the moment.</p>\r\n<br />\r\n<p>Its simple, clear dial pays tribute to the timeless codes of classic watchmaking, while reinterpreting them with an elegant modernity/ Faceted and shaped like a two-edged sword, the hands count off each second, each minute and each hour with the full precision of the self-winding chronometer movement at the heart of this prestigious timepiece.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/cellini_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>ELEGANCE, DAY IN, DAY OUT</h5>\r\n<h2>CELLINI DATE</h2>\r\n<p>The days go by in an infinite cycle: yesterday, today, tomorrow. Each day that passes is different, each day is essential. The Rolex Cellini Date model adds another function to the indication of hours, minutes and seconds: a date display imbued with elegance, tradition and poetry.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/cellini_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>TIME HERE AND TIME THERE</h5>\r\n<h2>CELLINI DUAL TIME</h2>\r\n<p>The Cellini Dual Time model grants its wearears the gift of temporal ubiquity. With a quick glance at the dial, They are simulataneously  aware of the time here\r\nand the time elesewhere. To differentiate daytime hours from night-time hours, a sun or moon symbol transists the apearture at 9 o\'clock on the subdial. The hour hand can be set independently by successive \"jumps\" to adjust to a new local time zone, without disturbing the functioning of the watch or the \r\nchronometric precision of its self-winding movement.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />CELLINI</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">Contact Us</a></div>\r\n</div>\r\n</div>','2017-07-08 08:58:20','2017-07-13 10:28:29',1),(14,'contact-us-content','contact-us-content','<div class=\"contact-banner-img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/contact-banner.jpg\"}}\" /></div>\r\n<div class=\"middle-cnt\">\r\n<div class=\"catgory-top-two\">\r\n<h5>VISIT US IN STORE</h5>\r\n<h2>CONTACT US</h2>\r\n<div class=\"home-top-one-content\">With the necessary skills, technical know-how and special equipment, we can guarantee the authenticity of each and every part of your Rolex. Let us help you make thye choice that will last you a lifetime, or answer any enquiry you may have. Please send us your details and your preferred mode of contact and we will respond as quickly as possible.</div>\r\n</div>\r\n</div>\r\n<div class=\"contact-details\">\r\n<div class=\"addressbg\">\r\n<div class=\"mapbg\"><iframe frameborder=\"0\" height=\"450\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1442.9970065428688!2d-79.39234684196575!3d43.66909433492967!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x882b34affff23ac3%3A0x579ead5997a15f4f!2s101+Bloor+St+W%2C+Toronto%2C+ON+M5S+3L7%2C+Canada!5e0!3m2!1sen!2s!4v1499678446272\" style=\"border: 0;\" width=\"100%\"></iframe></div>\r\n<div class=\"address-pos\">\r\n<div class=\"row\">\r\n<h1>ROYAL DE VERSAILLES</h1>\r\n<div class=\"col-sm-12\">\r\n<p>101 Bloor street West,<br />Toronto, ON,M5S 227, Canada</p>\r\n<br />\r\n<p>Tel: 1 416-967-7201</p>\r\n<br />\r\n<p>Mon-sat: 10:30am - 5:30pm<br />Closed Sunday</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2017-07-10 08:53:59','2017-07-13 11:04:09',1),(15,'View Page Block','view-page-block','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\" style=\"background-image: url(\'{{media url=\"wysiwyg/product-stitic-block.png\"}}\');\">&nbsp;</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h2>THE ARCHEYTYPE<br />OF THE DIVERS\'<br />WATCH</h2>\r\n<p>The Oyster perpetual Submariner is the quintessential divers\' watch, the benchmark in its genre. Introduced in 1953 during the pioneering era of scuba diving, it was the first watch to be water-resistance to 100 meters (330 feet).</p>\r\n<br />\r\n<p>This iconic timepiece has since evolved with a series of patented Rolex technical innovations, guaranteeing is reliability and precision down to depths of 300 meters (1.000 feet). At home in the oceans, where it remains in indispensable instruments for every diver, the Submariner has also conquered terra firma as the watch of action with a rugged elegance of its own</p>\r\n<a class=\"block-link\" href=\"#\">Read More</a></div>\r\n</div>','2017-07-12 12:23:04','2017-07-13 11:23:32',1),(16,'The Oyster Perpetual','the-oyster-perpetual','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/81fZB21CBxs\" width=\"100%\" height=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE OYSTER PERPETUAL</h5>\r\n<h2>LEGENDARY <br /> WATCHES</h2>\r\n<p>As forerunners, the Oyster Perpetual models are among the most recognizable in a collection of legendary watches. They have retained their unmistakable aesthetic association with the original Rolex Oysters while evolving with the watchmaking know-how of Rolex.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/oyster_feature_img1_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES</h5>\r\n<h2>THE OYSTER CASE, SYMBOL OF WATERPROOFNESS</h2>\r\n<p>The Oyster case is guaranteed waterproof to a depth of 100 metres (330 feet). Its middle case is crafted exclusively from a solid block of particularly corrosion‑resistant 904L steel. The Oyster case provides the high precision Rolex movement with optimal protection from water, dust, pressure and shocks.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/oyster_feature_img2_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES</h5>\r\n<h2>AN ENTIRE FAMILY</h2>\r\n<p>The Oyster Perpetual is available in a range of colours and sizes from 26 to 39 mm: a wide selection for a model that affords full access to the Rolex legend.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/oyster_feature_img3_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES</h5>\r\n<h2>OYSTER BRACELET</h2>\r\n<p>The Oyster bracelet is a perfect alchemy of form and function, aesthetics and technology. First introduced in the late 1930s, this particularly robust and comfortable metal bracelet with its broad, flat three-piece links remains the most universal bracelet in the Oyster collection.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />OYSTER PERPETUAL</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-26 03:08:06','2017-07-29 00:38:49',1),(17,'The Pearlmaster','the-pearlmaster','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://youtu.be/aLeb2fKaTYg\" style=\"background-image: url(\'wysiwyg/image/oyster_cover_video_640x360.jpg\');\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE PEARLMASTER</h5>\r\n<h2>FEMININE<br />INTERPRETATION</h2>\r\n<p>The Oyster Perpetual Pearlmaster has stood out since its launch in 1992, thanks to its elegant lines and precious materials. Set with diamonds, rubies or sapphires, it is a highly feminine interpretation of Rolex&rsquo;s emblematic Datejust.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/pearlmaster_feature_img1_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE PEARLMASTER</h5>\r\n<h2>THE ART AND CRAFT<br />OF ROLEX DIALS</h2>\r\n<p>Dial creation is nothing less than a true &ldquo;m&eacute;tier d&rsquo;art&rdquo;. Very few watchmaking companies besides Rolex master all the aspects of dial creation in-house. Mother-of-pearl, gold, meteorite and diamonds are just some of the fine materials used to ensure the beauty and individual character of each Rolex dial.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/pearlmaster_feature_img2_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE PEARLMASTER</h5>\r\n<h2>MASTERFUL<br />GEM-SETTING<br />BY ROLEX</h2>\r\n<p>To be worthy of being set on a Rolex watch, sapphires, rubies and diamonds are selected according to rigorous criteria, then set in keeping with the finest traditions to ensure the most intense radiance. Rolex has its own gemmology laboratory, where experienced specialists check the quality of precious stones using state-of-the-art equipment. The gems are then entrusted to the in-house master gem-setters, experts in the art of exalting the stones&rsquo; natural lustre.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/pearlmaster_feature_img3_640x560.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE PEARLMASTER</h5>\r\n<h2>PEARLMASTER BARCELET</h2>\r\n<p>With delightfully rounded solid links in 18 ct gold, the Pearlmaster bracelet contributes to the watch&rsquo;s distinctive character and offers the wearer maximum comfort. It is fitted with a concealed Crownclasp that is both elegant and functional. The Pearlmaster bracelet is also available with intermediate links set with diamonds. Echoing the bezel and dial, this superb gem-setting provides the finishing touch to an authentic watchmaking masterpiece.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />PEARLMASTER</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-26 05:31:14','2017-07-26 07:13:17',1),(18,'The Datajust','the-datajust','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>AN ICONIC SYMBOL OF STYLE</h5>\r\n<h2>THE DATEJUST</h2>\r\n<p>Introduced in 1945, the Datejust was the first wristwatch-chronometer to display the date through an aperture on the dial. Its unique magnifying Cyclops lens, added several years later, became a Rolex signature. Admired for its classic design, the Datejust has become an iconic symbol of style.</p>\r\n</div>\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/K4rcB9-YjDY\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/datejust_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DATEJUST</h5>\r\n<h2>WHAT A DIFFERENCE<br />A DATE MAKES</h2>\r\n<p>In the earliest models of the Datejust, the date would begin to change hours before its midnight rendezvous. In 1953, the date-change mechanism was adapted to operate instantaneously and the date aperture was enhanced with a Cyclops lens, magnifying the date for easy reading.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/datejust_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DATEJUST</h5>\r\n<h2>THE CYCLOPS LENS</h2>\r\n<p>Invented by Rolex in 1953, the Cyclops lens enhances the date aperture, magnifying the date display for easy reading. It is one of the most distinctive and recognisable Rolex features.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-middle-banner\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/datejust_banner_img2_1680x420.jpg\"}}\" /></div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/datejust_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEMININITY IN ALL ITS DIVERSITY</h5>\r\n<h2>THE LADY-DATEJUST</h2>\r\n<p>The Lady-Datejust, which appeared in 1957, was the first ladies&rsquo; version of classic Rolex date chronometer, the Datejust, carrying its heritage of timeless elegance and functionality in an exquisite size suited to a woman&rsquo;s wrist. The Rolex Lady-Datejust comes in a wealth of versions to perfectly reflect the different personalities of its wearers. The range of materials and colours of the Lady-Datejust is equalled only by the variety of bracelets and dials that add to its style.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/datejust_feature_img4_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>THE LADY-DATEJUST</h5>\r\n<h2>A GEM FOR<br />DAILY WEAR</h2>\r\n<p>The Oyster Perpetual Lady-Datejust concentrates all the attributes of the iconic Rolex Datejust in its smaller 28 mm case. The timeless elegance of this gem for daily wear is enhanced by dials of subtle and shimmering colour, by noble materials and sparkling diamonds.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />DATEJUST</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-26 06:37:50','2017-07-29 01:29:09',1),(19,'The Day-Date','the-day-date','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://youtu.be/K4rcB9-YjDY \" style=\"background-image: url(\'wysiwyg/image/oyster_cover_video_640x360.jpg\');\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE DAY-DATE</h5>\r\n<h2>A SYMBOL OF EXCELLENCE AND PRESTIGE</h2>\r\n<p>From its launch in 1956, the Day-Date was immediately recognized as the watch worn by influential people. The Day-Date was the first calendar wristwatch to display the day written in full, as well as the date. Faithful to its noble origins, the Day-Date is made exclusively of 18 ct gold or 950 platinum.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/4-Day-Date-Family-Page/day-date_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAY-DATE</h5>\r\n<h2>MONDAY, LUNDI</h2>\r\n<p>Introduced in 1956, the Day-Date was a world first: the first wristwatch to indicate the day of the week spelt out in full. Worn by many world leaders, the Day-Date is available with a bespoke day display in a wide choice of languages.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/4-Day-Date-Family-Page/day-date_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAY-DATE</h5>\r\n<h2>PRECIOUS METALS</h2>\r\n<p>The Day-Date has always embodied prestige and exclusivity. A hallmark of its nobility, the Day-Date is produced exclusively in 950 platinum or in 18 ct gold. The bezel can be fluted, smooth or, on the gem-set versions, arrayed in the most beautiful of precious stones.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/4-Day-Date-Family-Page/day-date_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE DAY-DATE</h5>\r\n<h2>PRESIDENT BRACELET</h2>\r\n<p>Designed specially for the Day-Date at its launch in 1956, the elegant and imposing President bracelet is inherent to the standing of the model. Immediately recognizable on a wrist, this solid gold or platinum bracelet with three semi‑circular links provides complete reliability and comfort.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />DAY-DATE</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-26 08:19:29','2017-07-28 04:03:20',1),(20,'Sky-Dweller','sky-dweller','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/iDDBHaxIDl4\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE ROLEX SKY-DWELLER</h5>\r\n<h2>THE EXQUISITE SIMPLICITY OF TRACKING TIME</h2>\r\n<p>The Sky-Dweller\'s off-centre disc for the second time zone gives the watch excellent legibility and distinct aesthetics. During travel the reference time is indicated by a fixed red triangle, symbolizing the wearer\'s usual place of residence or work. The 24-hour display allows for unmistakeable distinction between daytime hours and nighttime hours in the distant time zone.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/5-Sky-Dweller-Family-Page/sky-dweller_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SKY-DWELLER</h5>\r\n<h2>DUAL TIME ZONE</h2>\r\n<p>The two time zones are displayed simultaneously. Local time is indicated by the conventional centre hour, minute and seconds hands. It can be set quickly and easily by means of a mechanism that allows the hour hand to be adjusted independently in one-hour increments both forwards and backwards. Neither the minute and seconds nor the reference time in the second time zone are affected. And, since the watch is not stopped, accuracy is preserved. Reference time in the traveller&rsquo;s usual place of residence or work is read on a rotating off-centre disc.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/5-Sky-Dweller-Family-Page/sky-dweller_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SKY-DWELLER</h5>\r\n<h2>ANNUAL CALENDAR</h2>\r\n<p>The current month is indicated in deep red within one of 12 windows around the dial, a striking characteristic of the Saros annual calendar. This ingenious mechanism simplifies life for the wearer of the watch, who no longer needs to think about adjusting the date at the end of a 30-day month. The annual calendar displays the correct date through the year. Only one adjustment is needed &ndash; on 1 March (February having only 28 or 29 days). The date is connected to local time and automatically changes according to the traveller&rsquo;s local time zone.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/5-Sky-Dweller-Family-Page/sky-dweller_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SKY-DWELLER</h5>\r\n<h2>RING COMMAND BEZEL</h2>\r\n<p>The rotatable Ring Command bezel interacts with the movement to allow the global traveller to easily access the watch functions that need setting. The bezel can be turned to one of three positions to select the date, local time or reference time. The selected function can then be rapidly adjusted in either direction using the winding crown. This intuitive interface is based on a complex mechanical module with no fewer than 60 components, the product of state-of-the-art watchmaking and advanced micromechanics. Such innovation epitomizes Rolex\'s in-house mastery of the design and manufacture of all the essential components of the watch.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />SKY-DWELLER</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 01:59:41','2017-07-29 01:29:48',1),(21,'THE GMT-MASTER II','the-gmt-master-ii','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/ICur9sm38fU\"  width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE GMT-MASTER II</h5>\r\n<h2>KEEPING PACE WITH CHANGING TIMES</h2>\r\n<p>Although the GMT-Master II was designed essentially for professional pilots, its combination of peerless functionality and rugged good looks has attracted a wider travelling public. As well as appreciating its ability to display different time zones, these travellers admire the robustness and versatile appearance that make the GMT‑Master II eminently suitable for globetrotting and, indeed, for any occasion.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/6-GMT-Master-II-family-page/gmt-master_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE GMT-MASTER II</h5>\r\n<h2>24-HOUR DISPLAY<br />AND INDEPENDENT<br />HOUR HAND</h2>\r\n<p>In addition to conventional hour, minute and seconds hands, the GMT-Master II features an arrow-tipped hand, which circles the dial once every 24 hours, as well as a bidirectional rotatable 24-hour graduated bezel. The distinctively coloured 24-hour hand displays a second time zone, which can be read on the graduated the bezel.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/6-GMT-Master-II-family-page/gmt-master_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE GMT-MASTER II</h5>\r\n<h2>3186 MOVEMENT</h2>\r\n<p>The GMT-Master II is equipped with calibre 3186, a self‑winding mechanical movement entirely developed and manufactured by Rolex. In addition to the conventional hour, minute and seconds hands, it features a 24-hour hand to display a second time zone. Like all Rolex Perpetual movements, the 3186 is a certified Swiss chronometer, a designation reserved for high-precision watches that have successfully passed the Swiss Official Chronometer Testing Institute (COSC) tests.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/6-GMT-Master-II-family-page/gmt-master_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE GMT-MASTER II</h5>\r\n<h2>CERACHROM BEZEL</h2>\r\n<p>Manufactured by Rolex from an extremely hard ceramic material, the exclusive Cerachrom bezel insert and monobloc bezel have excellent anti-corrosion properties and keep their vibrant colours over time. They are virtually scratchproof, and are unaffected by exposure to sunlight as well as to chlorinated or sea water.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />GMT-MASTER II</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 02:36:55','2017-07-29 01:41:20',1),(22,'THE AIR-KING','the-air-king','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/VIMcmsyfKL8\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE AIR-KING</h5>\r\n<h2>AERONAUTICAL HERITAGE</h2>\r\n<p>In 2016 Rolex introduced the Oyster Perpetual Air-King, a watch that perpetuates the aeronautical heritage of the original Rolex Oyster. The new Air-King, with a 40 mm case in 904L steel, features a distinctive black dial with a combination of large 3, 6 and 9 numerals marking the hours and a prominent minute scale for navigational time readings. The dial bears the name Air-King in the same lettering that was designed specially for the model in the 1950s.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/7-Air-King-Family-Page/airking_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE AIR-KING</h5>\r\n<h2>THE OYSTER CASE</h2>\r\n<p>The Air-King&rsquo;s Oyster case, guaranteed waterproof to a depth of 100 metres (330 feet), is a paragon of robustness. Its characteristically shaped middle case is crafted from a solid block of particularly corrosion-resistant 904L steel. The fluted case back is hermetically screwed down with a special tool that allows only Rolex watchmakers to access the movement. Fitted with the Twinlock double waterproofness system, the winding crown screws down securely against the case.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/7-Air-King-Family-Page/airking_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE AIR-KING</h5>\r\n<h2>PERPETUAL CALIBRE 3131</h2>\r\n<p>The Air-King is equipped with calibre 3131, a self-winding mechanical movement entirely developed and manufactured by Rolex. Its architecture, manufacturing quality and innovative features make it singularly precise and reliable. The oscillator, the true heart of the watch, has a blue Parachrom hairspring patented and manufactured by Rolex in an exclusive alloy.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/7-Air-King-Family-Page/airking_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE AIR-KING</h5>\r\n<h2>SOLID-LINK BRACELET AND EASYLINK</h2>\r\n<p>The Air-King is fitted on a solid-link Oyster bracelet in 904L steel with a folding Oysterclasp. This bracelet features the ingenious Rolex-patented Easylink rapid extension system that allows the wearer to easily increase the bracelet length by approximately 5 mm, for additional comfort in any circumstance.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />AIR-KING</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 02:56:32','2017-07-29 01:51:25',1),(23,'THE ROLEX EXPLORER','the-rolex-explorer','<div class=\"home-cnt-middle responsive-first\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/Xu09ug9csPE\" style=\"background-image: url(\'wysiwyg/image/oyster_cover_video_640x360.jpg\');\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>LEGENDARY LEGIBILITY</h5>\r\n<h2>THE EXPLORER II</h2>\r\n<p>A scratch resistant sapphire crystal, a clear dial and special luminescent markings allow the rugged Rolex Explorer II to be read even in the most challenging conditions, while its trademark orange 24-hour hand helps polar and underground adventurer differentiate between daytime and night time hours without the reference of the sun.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/8-Explorer-Family-Page/explorer_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX EXPLORER II</h5>\r\n<h2>INDEPENDENT <br /> HOUR HAND</h2>\r\n<p>An independent hour hand, which provides a second zone function in conjunction with the fixed, or &ldquo;home&rdquo;, 24-hour display, and an integrated Cyclops lens that magnifies the date, are other functions that make the Explorer II highly appreciated by global adventurers.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/8-Explorer-Family-Page/explorer_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX EXPLORER II</h5>\r\n<h2>24-HOUR BEZEL</h2>\r\n<p>The Explorer II is equipped with an additional 24-hour display; a dedicated hand circles the dial in 24 hours rather than the usual 12, pointing to a fixed bezel with 24-hour graduations. This function enables the wearer to distinguish the hours of the day from the hours of the night, an essential feature for those who venture into environments where darkness reigns supreme such as in the depths of caves, or where the sun never sets like the polar regions in summer.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle\" style=\"margin-top: 0;\">\r\n<div class=\"home-cnt-middle-left\" style=\"min-height: auto;\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/8-Explorer-Family-Page/explorer_cover_video2_840x480.jpg\"}}\" /></div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>CRAFTED AROUND EXPERIENCE</h5>\r\n<h2>THE EXPLORER</h2>\r\n<p>The Rolex Explorer benefited from experience gained in the Himalayas, acquiring its clearly distinctive hour and minute hands and its landmark, highly legible black dial with luminescent indices and large Arabic numerals at 3, 6 and 9 o\'clock. It is designed for optimal legibility even in the dark.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/8-Explorer-Family-Page/explorer_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE EXPLORER</h5>\r\n<h2>904L STAINLESS STEEL</h2>\r\n<p>Rolex uses 904L stainless steel for all its steel watches. This high-performance alloy is mainly used in the high technology, aerospace and chemical industries, where maximum resistance to corrosion is essential. 904L steel is extremely resistant and highly polishable. It maintains its beauty even in the harshest environments.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/8-Explorer-Family-Page/explorer_feature_img4_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE EXPLORER</h5>\r\n<h2>CHROMALIGHT DISPLAY</h2>\r\n<p>The high-contrast, Chromalight display innovates by pushing the boundaries of visibility in dark environments. The blue glow of the hour markers and hands lasts up to eight hours with a uniform luminosity throughout, practically twice as long as that of standard luminescent materials.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />DATEJUST</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 03:18:54','2017-07-29 04:54:08',1),(24,'THE MILGAUSS','the-milgauss','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/V0DrS0D18xE\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>STYLE OF THE MILGAUSS</h5>\r\n<h2>INSTANTLY RECOGNISABLE</h2>\r\n<p>The Milgauss has remained faithful to its scientific heritage and unique identity as it has evolved. With its clean lines and evocative orange seconds hand, shaped like a lightning bolt to echo the original model, the Milgauss is recognisable at a glance.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/9-Milgauss-family-page/milgauss_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE MILGAUSS</h5>\r\n<h2>AN EFFICIENT SHIELDING SYSTEM</h2>\r\n<p>The first innovation at the heart of the Milgauss\' resistance to magnetic interference is the shield inside its Oyster case. Made of ferromagnetic alloys selected by Rolex, it surrounds and protects the movement. The symbol for magnetic flux density &ndash; the capital letter \'B\' with an arrow &ndash; is engraved in this magnetic shield, but only Rolex-certified watchmakers will ever see it.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/9-Milgauss-family-page/milgauss_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE MILGAUSS</h5>\r\n<h2>3131 MOVEMENT</h2>\r\n<p>The Milgauss is equipped with calibre 3131, a self-winding mechanical movement entirely developed and manufactured by Rolex. It incorporates state-of-the-art technologies patented by the brand that ensure exceptional resistance to magnetic fields. Like all Rolex Perpetual movements, the 3131 is a certified Swiss chronometer, a designation reserved for high-precision watches that have successfully passed the Swiss Official Chronometer Testing Institute (COSC) tests.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/9-Milgauss-family-page/milgauss_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE MILGAUSS</h5>\r\n<h2>GREEN SAPHIRE CRYSTAL</h2>\r\n<p>A unique watch crystal in green sapphire developed in 2007 by Rolex. Scratchproof, fade-proof and available exclusively on the Milgauss. Its light green shade, tinted throughout the entire crystal, turns nearly luminescent at the bevelled edges. The result of a secret process that required years of development to master and takes weeks to produce. Not patented, as it is so difficult to make that no one else would even venture to try.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />MILGAUSS</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 04:04:32','2017-07-29 03:01:39',1),(25,'The Yacht-Master','the-yacht-master','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/z01fLn2lsUc\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>CHARTING ITS COURSE</h5>\r\n<h2>THE YACHT-MASTER II</h2>\r\n<p>The Yacht-Master II is designed to meet the needs of professional sailors. This regatta chronograph features the world\'s first programmable countdown with a mechanical memory. It provides precise synchronisation with the crucial starting sequence of a yacht race. The design of the Yacht-Master II is inspired by Maxi yachts, those masters of the seas that marry technology, elegance and performance. Its lines are fluid and functional. The pushers suggest racing yacht winches. On the bezel, the name of the Yacht-Master II is displayed like the name of a boat on the hull. The rotatable Ring Command bezel, with its function of setting the regatta countdown, is reminiscent of a yacht&rsquo;s wheel.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/11-Yacht-Master-Family-Page/yacht-master_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX YACHT-MASTER II</h5>\r\n<h2>ON-THE-FLY SYNCHRONISATION</h2>\r\n<p>As in any contest of speed, precision is of the essence in a regatta. The Yacht-Master II features an unprecedented mechanical function: a countdown that can be programmed from 1 to 10 minutes and allows skippers to precisely time and follow each race&rsquo;s official starting procedure. This flexibility is one of the major assets of the Yacht-Master II; its development was a considerable technological challenge. Rolex engineers devoted 35,000 hours to developing this complication. The programming can be mechanically memorised. Furthermore, once the watch&rsquo;s countdown is launched, it can be synchronised with the official race countdown.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/11-Yacht-Master-Family-Page/yacht-master_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX YACHT-MASTER II</h5>\r\n<h2>RING COMMAND BEZEL</h2>\r\n<p>Rolex achieved perfection when it turned its attention to redefining the purpose and functionality of the bezel. Typically, a rotatable bezel operates independently from the internal mechanism; however, the Ring Command bezel of the Yacht-Master II regatta chronograph operates in conjunction with it. The bezel literally acts as the key to the programmable countdown. Complex in design, but simple in use, it is functionally beautiful.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle  responsive-first\" style=\"margin-top: 0;\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/qZyblz4NQWE\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>SLEEK, SPORTY, DISTINGUISHED</h5>\r\n<h2>THE YACHT-MASTER</h2>\r\n<p>Sleek, sporty, distinguished: the Oyster Perpetual Yacht-Master symbolizes the privileged ties between Rolex and the world of sailing that stretch back to the 1950s. It is the only Oyster Professional model offered in two sizes: 40 and 37 mm.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/11-Yacht-Master-Family-Page/yacht-master_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX YACHT-MASTER</h5>\r\n<h2>THE BIDIRECTIONAL ROTATABLE BEZEL</h2>\r\n<p>The Yacht-Master&rsquo;s bidirectional rotatable 60-minute graduated bezel is made of Cerachrom insert in black ceramic, 18 ct yellow gold or 950 platinum. The raised polished numerals and graduations stand out clearly against a matt, sand-blasted background. This functional bezel - which allows the wearer to calculate, for example, the sailing time between two buoys - is also a key component in the model&rsquo;s distinctive visual identity.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/11-Yacht-Master-Family-Page/yacht-master_feature_img4_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX YACHT-MASTER</h5>\r\n<h2>THE OYSTERFLEX BRACELET</h2>\r\n<p>The Yacht-Master&rsquo;s new Oysterflex bracelet, developed and patented by Rolex, offers an attractive alternative to metal bracelets. The bracelet attaches to the watch case and the Oysterlock safety clasp by a flexible titanium and nickel alloy metal blade. The blade is over moulded with high-performance black elastomer, which is particularly resistant to environmental effects and very durable. For enhanced comfort, the inside of the Oysterflex bracelet is equipped with a patented longitudinal cushion system that stabilizes the watch on the wrist, and fitted with an 18 ct Everose gold Oysterlock safety clasp that prevents accidental opening.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />YACHT-MASTER</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 04:18:24','2017-07-29 04:29:45',1),(26,'THE ROLEX SEA-DWELLER','the-rolex-sea-dweller','<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>BLACK DIAL AND RED NAME</h5>\r\n<h2>THE ROLEX SEA-DWELLER</h2>\r\n<p>The dial is the distinctive face of a Rolex watch, the feature most responsible for its identity and readability. Characterised by hour markers fashioned from 18 ct gold to prevent tarnishing, every Rolex dial is designed and manufactured in-house, largely by hand to ensure perfection. The dial of the new Sea-Dweller carries the model&rsquo;s name in red, a reference to the first model.</p>\r\n</div>\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/8R1ubtHT5-Y\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"catgory-top-two last\">\r\n<h5>FEATURES OF THE ROLEX SEA-DWELLER</h5>\r\n<h2>CERAMIC BEZEL INSERT AND<br /> LONG-LASTING LUMINESCENT DISPLAY</h2>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block center-content\" style=\"margin-top: 0;\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_mosaic_image_1023x690.jpg\"}}\" /></a></div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\" style=\"margin-top: 0;\">\r\n<p>The Sea-Dweller&rsquo;s 60-minute graduated, unidirectional rotatable bezel enables divers to safely monitor their dive and decompression times. It is equipped with a patented black Cerachrom bezel insert manufactured by Rolex in a virtually scratchproof ceramic whose colour is unaffected by ultraviolet rays. The graduation is coated via PVD (Physical Vapour Deposition) with a thin layer of platinum. The sleek black dial features large Chromalight hour markers and hands filled with luminescent material that emits a long-lasting blue glow for excellent legibility in dark conditions.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-middle-banner\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_banner_img2_1680x420.jpg\"}}\" /></div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_feature_img1_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SEA-DWELLER</h5>\r\n<h2>THE HELIUM ESCAPE VALVE</h2>\r\n<p>Before they return to the open air, professional divers heading for the surface after a deep saturation dive must spend time in a decompression chamber, where they breathe a gas mixture containing helium. The tiny molecules of helium, an extremely light gas, infiltrate into the watch. During decompression, the helium is unable to escape from the waterproof case quickly enough, creating a pressure differential that could force the crystal out of the watch case. Rolex engineers created a gas escape valve fitted with a spring: it opens when the difference in pressure between the inside and outside of the watch reaches 3 to 5 bars, allowing the helium to escape, thereby protecting the watch.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_feature_img2_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX SEA-DWELLER</h5>\r\n<h2>THE ROLEX<br />GLIDELOCK<br />EXTENSION SYSTEM</h2>\r\n<p>The patented Rolex Glidelock extension system allows divers to adjust the length of the bracelet for a secure and comfortable fit over a diving suit, without using any tools. A robust toothed panel under the clasp cover provides an extension of up to 20 mm in 2 mm increments.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle\" style=\"margin-top: 0;\">\r\n<div class=\"home-cnt-middle-left\">\r\n<div id=\"video-wrapper\">\r\n<div class=\"video-container\"><iframe frameborder=\"0\" height=\"100%\" src=\"https://www.youtube.com/embed/sNNIwWP4Bjk\" style=\"background-image: url(\'wysiwyg/image/oyster_cover_video_640x360.jpg\');\" width=\"100%\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h5>THE LAST FRONTIER</h5>\r\n<h2>THE ROLEX DEEPSEA</h2>\r\n<p>The robust 44 mm case in 904L stainless steel, thick domed sapphire crystal and unidirectional rotatable bezel with a 60-minute graduated black Cerachrom insert exude the purposeful character of the Rolex Deepsea. It is the uncompromising divers&rsquo; watch, built for the most demanding underwater missions.</p>\r\n<p>In 2014 Rolex announced the release of the Rolex Deepsea D-blue Dial, commemorating James Cameron&rsquo;s historic solo dive to the bottom of the Mariana Trench, some 11,000 metres deep. From twilight blue to bottomless black, its two-colour gradient dial celebrates one man&rsquo;s journey to the deepest place on earth.</p>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_feature_img3_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX DEEPSEA</h5>\r\n<h2>THE RINGLOCK<br />SYSTEM</h2>\r\n<p>The Rolex Deepsea owes its exceptional strength, waterproofness and pressure resistance to the exclusive Ringlock system. This innovative case architecture patented by Rolex enables the watch to resist the massive pressure exerted by water at the depth of 3,900 metres (12,800 feet), equivalent to a weight of approximately 3 tonnes on the watch. Its construction is based on three elements: a nitrogen-alloyed steel central ring forms the backbone of the system, accompanied by a 5.5 mm‑thick, domed sapphire crystal and a case back in grade 5 titanium.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/image/10-Sea-Dweller-Family-Page/sea-dweller_feature_img4_570x500.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>FEATURES OF THE ROLEX DEEPSEA</h5>\r\n<h2>THE TITANIUM<br />CASE BACK</h2>\r\n<p>The case architecture that enables the Rolex Deepsea to resist the colossal pressure exerted by water at great depths takes advantage of two surprising features. First of all, the strong titanium case back is almost imperceptibly flexible thanks to the natural qualities of the alloy, making it extremely resilient to such huge forces. Secondly, the water pressure itself forces the three core components of the Ringlock System, including the case back, tighter and tighter together as the depth increases, naturally reinforcing the hermetic seal of the case.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<h5>AT YOUR SERVICE</h5>\r\n<h2>EXPERIENCE A ROLEX<br />SEA-DWELLER</h2>\r\n<div class=\"cat-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">CONTACT US</a></div>\r\n</div>\r\n</div>','2017-07-28 04:41:14','2017-07-29 03:33:53',1);
