INSERT INTO `cms_page` VALUES (1,'404 Not Found 1','two_columns_right','Page keywords','Page description','no-route',NULL,'\n<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class=\"disc\">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class=\"disc\">\n            <li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a>\n            <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n','2017-07-06 07:31:55','2017-07-06 07:31:55',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home page','one_column',NULL,NULL,'home',NULL,'<div class=\"bannerbg-home\"><img alt=\"\" src=\"{{media url=\"wysiwyg/Landing_top_banner_img_1680x420.jpg\"}}\" /></div>\r\n<div class=\"middle-cnt\">\r\n<div class=\"home-top-one\">\r\n<h5>WELCOME TO ROYAL VERSAILLS</h5>\r\n<h2>OFFICIAL ROLEX RETAILER</h2>\r\n<div class=\"home-top-one-content\">\r\n<p>Royal de Versailles is proud of be part of the worldwide network of Official Rolex Retailers, allowed to sell and maintain Rolex watches. With the necessary skills, technical know-how and special equipment, we guarantee the authenticity of each and every part of your Rolex. Browse the Rolex collection below, or simply contact us to book an appointment with our dedicated staff, who can help you make the choice that will last a lifetime.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<hr />\r\n<div class=\"middle-cnt\">\r\n<div class=\"home-top-two\">\r\n<h5>EXPERIENCE A ROLEX</h5>\r\n<h2>ROLEX WATCHES</h2>\r\n<div class=\"home-top-one-content\">Rolex watches are crafted from the finest raw materials and assembled with scrupulous attention to detail. Every component is designed, developed and produced to the most exacting standards.</div>\r\n</div>\r\n</div>\r\n<div class=\"middle-cnt\">\r\n<div class=\"homepage-products\">{{block type=\"catalog/product_list\" name=\"home.catalog.product.list\" alias=\"products_homepage\" category_id=\"9\" template=\"catalog/product/home-page-products.phtml\"}}</div>\r\n</div>\r\n<div class=\"home-cnt-middle\">\r\n<div class=\"home-cnt-middle-left\" style=\"background-image: url(\'{{media url=\"wysiwyg/Landing_video_img_840x480_1.jpg\"}}\');\">&nbsp;</div>\r\n<div class=\"home-cnt-middle-right\">\r\n<h2>WATCHMAKING,<br />THE ROLEX WAY</h2>\r\n<p>Pioneer in the development of the wristwatch, Rolex designs, develops and produces in-house all the essential components of its watches, from the casting of the gold alloys to the machining, crafting, assembly and finishing of the movement, case, dial and bracelet.</p>\r\n<p>Rolex is at the origin of numerous major watchmaking innovations, and has registered over 400 patents in the course of its history. Switzerland is the crucible where Rolex watches are brought to life thanks to the know-how and commitment of more than 6,000 employees at the brand&rsquo;s four sites, all at the cutting edge of watchmaking technology.</p>\r\n</div>\r\n</div>\r\n<div class=\"home-cnt-bottom\">\r\n<div class=\"middle-cnt\">\r\n<div class=\"home-cnt-bottom-inner\">\r\n<h2>VISIT US IN STORE</h2>\r\n<div class=\"home-cnt-bottom-inner-img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/Landing_store_img_820x547.jpg\"}}\" /></div>\r\n<p>At Royal de Versailles, we are at your service to help you choose the Rolex watch that best suits you, within the wide range of Rolex timepieces. Our store located on Bloor Street, Toronto is recognized as an Official Rolex Retailer as we only sell guaranteed Rolex timepieces.</p>\r\n<div class=\"home-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">Contact Us</a></div>\r\n</div>\r\n<div></div>\r\n</div>\r\n</div>','2017-07-06 07:31:55','2017-07-17 11:44:36',1,0,'<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->',NULL,NULL,NULL,NULL,NULL),(3,'About Us','two_columns_right',NULL,NULL,'about-us',NULL,'<div class=\"page-title\">\r\n<h1>About Magento Store</h1>\r\n</div>\r\n<div class=\"col3-set\">\r\n<div class=\"col-1\">\r\n<p style=\"line-height: 1.2em;\"><small>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis semper, pede.</small></p>\r\n<p style=\"color: #888; font: 1.2em/1.4em georgia, serif;\">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis semper, pede. Cras vel libero id lectus rhoncus porta.</p>\r\n</div>\r\n<div class=\"col-2\">\r\n<p><strong style=\"color: #de036f;\">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit.</strong></p>\r\n<p>Vivamus tortor nisl, lobortis in, faucibus et, tempus at, dui. Nunc risus. Proin scelerisque augue. Nam ullamcorper. Phasellus id massa. Pellentesque nisl. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc augue. Aenean sed justo non leo vehicula laoreet. Praesent ipsum libero, auctor ac, tempus nec, tempor nec, justo.</p>\r\n<p>Maecenas ullamcorper, odio vel tempus egestas, dui orci faucibus orci, sit amet aliquet lectus dolor et quam. Pellentesque consequat luctus purus. Nunc et risus. Etiam a nibh. Phasellus dignissim metus eget nisi. Vestibulum sapien dolor, aliquet nec, porta ac, malesuada a, libero. Praesent feugiat purus eget est. Nulla facilisi. Vestibulum tincidunt sapien eu velit. Mauris purus. Maecenas eget mauris eu orci accumsan feugiat. Pellentesque eget velit. Nunc tincidunt.</p>\r\n</div>\r\n<div class=\"col-3\">\r\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobo