<li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n','2017-07-06 07:31:55','2017-07-06 07:31:55',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Privacy Policy','one_column',NULL,NULL,'privacy-policy','Privacy Policy','<p style=\"color: #ff0000; font-weight: bold; font-size: 13px;\">Please replace this text with you Privacy Policy. Please add any additional cookies your website uses below (e.g., Google Analytics)</p>\r\n<p>This privacy policy sets out how {{config path=\"general/store_information/name\"}} uses and protects any information that you give {{config path=\"general/store_information/name\"}} when you use this website. {{config path=\"general/store_information/name\"}} is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified when using this website, then you can be assured that it will only be used in accordance with this privacy statement. {{config path=\"general/store_information/name\"}} may change this policy from time to time by updating this page. You should check this page from time to time to ensure that you are happy with any changes.</p>\r\n<h2>What we collect</h2>\r\n<p>We may collect the following information:</p>\r\n<ul>\r\n<li>name</li>\r\n<li>contact information including email address</li>\r\n<li>demographic information such as postcode, preferences and interests</li>\r\n<li>other information relevant to customer surveys and/or offers</li>\r\n</ul>\r\n<p>For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.</p>\r\n<h2>What we do with the information we gather</h2>\r\n<p>We require this information to understand your needs and provide you with a better service, and in particular for the following reasons:</p>\r\n<ul>\r\n<li>Internal record keeping.</li>\r\n<li>We may use the information to improve our products and services.</li>\r\n<li>We may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.</li>\r\n<li>From time to time, we may also use your information to contact you for market research purposes. We may contact you by email, phone, fax or mail. We may use the information to customise the website according to your interests.</li>\r\n</ul>\r\n<h2>Security</h2>\r\n<p>We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p>\r\n<h2>How we use cookies</h2>\r\n<p>A cookie is a small file which asks permission to be placed on your computer\'s hard drive. Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit a particular site. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.</p>\r\n<p>We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic and improve our website in order to tailor it to customer needs. We only use this information for statistical analysis purposes and then the data is removed from the system.</p>\r\n<p>Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us. You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.</p>\r\n<h2>Links to other websites</h2>\r\n<p>Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.</p>\r\n<h2>Controlling your personal information</h2>\r\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\r\n<ul>\r\n<li>whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by anybody for direct marketing purposes</li>\r\n<li>if you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by writing to or emailing us at {{config path=\"trans_email/ident_general/email\"}}</li>\r\n</ul>\r\n<p>We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen.</p>\r\n<p>You may request details of personal information which we hold about you under the Data Protection Act 1998. A small fee will be payable. If you would like a copy of the information held on you please write to {{config path=\"general/store_information/address\"}}.</p>\r\n<p>If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible, at the above address. We will promptly correct any information found to be incorrect.</p>\r\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\r\n<p>The table below lists the cookies we collect and what information they store.</p>\r\n<table class=\"data-table\">\r\n<thead>\r\n<tr><th>COOKIE name</th><th>COOKIE Description</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr><th>CART</th>\r\n<td>The association with your shopping cart.</td>\r\n</tr>\r\n<tr><th>CATEGORY_INFO</th>\r\n<td>Stores the category info on the page, that allows to display pages more quickly.</td>\r\n</tr>\r\n<tr><th>COMPARE</th>\r\n<td>The items that you have in the Compare Products list.</td>\r\n</tr>\r\n<tr><th>CURRENCY</th>\r\n<td>Your preferred currency</td>\r\n</tr>\r\n<tr><th>CUSTOMER</th>\r\n<td>An encrypted version of your customer id with the store.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_AUTH</th>\r\n<td>An indicator if you are currently logged into the store.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_INFO</th>\r\n<td>An encrypted version of the customer group you belong to.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_SEGMENT_IDS</th>\r\n<td>Stores the Customer Segment ID</td>\r\n</tr>\r\n<tr><th>EXTERNAL_NO_CACHE</th>\r\n<td>A flag, which indicates whether caching is disabled or not.</td>\r\n</tr>\r\n<tr><th>FRONTEND</th>\r\n<td>You sesssion ID on the server.</td>\r\n</tr>\r\n<tr><th>GUEST-VIEW</th>\r\n<td>Allows guests to edit their orders.</td>\r\n</tr>\r\n<tr><th>LAST_CATEGORY</th>\r\n<td>The last category you visited.</td>\r\n</tr>\r\n<tr><th>LAST_PRODUCT</th>\r\n<td>The most recent product you have viewed.</td>\r\n</tr>\r\n<tr><th>NEWMESSAGE</th>\r\n<td>Indicates whether a new message has been received.</td>\r\n</tr>\r\n<tr><th>NO_CACHE</th>\r\n<td>Indicates whether it is allowed to use cache.</td>\r\n</tr>\r\n<tr><th>PERSISTENT_SHOPPING_CART</th>\r\n<td>A link to information about your cart and viewing history if you have asked the site.</td>\r\n</tr>\r\n<tr><th>POLL</th>\r\n<td>The ID of any polls you have recently voted in.</td>\r\n</tr>\r\n<tr><th>POLLN</th>\r\n<td>Information on what polls you have voted on.</td>\r\n</tr>\r\n<tr><th>RECENTLYCOMPARED</th>\r\n<td>The items that you have recently compared.</td>\r\n</tr>\r\n<tr><th>STF</th>\r\n<td>Information on products you have emailed to friends.</td>\r\n</tr>\r\n<tr><th>STORE</th>\r\n<td>The store view or language you have selected.</td>\r\n</tr>\r\n<tr><th>USER_ALLOWED_SAVE_COOKIE</th>\r\n<td>Indicates whether a customer allowed to use cookies.</td>\r\n</tr>\r\n<tr><th>VIEWED_PRODUCT_IDS</th>\r\n<td>The products that you have recently viewed.</td>\r\n</tr>\r\n<tr><th>WISHLIST</th>\r\n<td>An encrypted list of products added to your Wishlist.</td>\r\n</tr>\r\n<tr><th>WISHLIST_CNT</th>\r\n<td>The number of items in your Wishlist.</td>\r\n</tr>\r\n</tbody>\r\n</table>','2017-07-06 07:31:55','2017-07-07 13:15:18',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'watch','one_column',NULL,NULL,'custom-page','Watch','<div class=\"banner-img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch-banner.jpg\"}}\" /></div>\r\n<div class=\"middle-cnt\">\r\n<div class=\"catgory-top-two\">\r\n<h5>WELCOME TO ROYAL DE VERSAILLES</h5>\r\n<h2>OFFICIAL ROLEX RETAILER</h2>\r\n<div class=\"home-top-one-content\">Since Royal De Versailles Jewellers first opened in 1992, Rolex has been a key player and a valued brand of the store. Located in Toronto&rsquo;s prestigious and iconic Yorkville, Royal De Versailles Jewellers is known as one of Canada&rsquo;s most sought after jewellery and watch dealers. In October of 2007 Rolex opened their very own boutique in the store, the first ever boutique to have been opened in Canada, and the relationship between the two has continued to grow in a perfect partnership.</div>\r\n</div>\r\n</div>\r\n<div class=\"watch-cnt-middle\">\r\n<div class=\"watch-cnt-middle-left\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch-banner-left.jpg\"}}\" /></div>\r\n<div class=\"watch-cnt-middle-right\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch-banner-right.jpg\"}}\" /></div>\r\n</div>\r\n<div class=\"category-inner-cnt\">\r\n<div class=\"cat-cnt-block\">\r\n<div class=\"category-inner-cnt-top\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch_feature_img1.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>THE ROYAL EXPERIENCE</h5>\r\n<h2>PURCHASING YOUR ROLEX</h2>\r\n<p>The experience of purchasing a Rolex watch at Royal De Versailles Jewellers is one like no other. Our staff are extremely passionate and highly knowledgeable, and can be sure to find the right Rolex model for you.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-middle\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch_feature_img2.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>ROLEX BOUTIQUE</h5>\r\n<h2>LARGE SELECTION</h2>\r\n<p>Our beautiful boutique offers a very large selection of Rolex watches, and at RdeV we pride ourselves on our quality of customer service both during and after the purchase of your timepiece.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"category-inner-cnt-bottom\">\r\n<div class=\"cat-cnt-block-left\"><a href=\"#\"><img alt=\"\" src=\"{{media url=\"wysiwyg/watch_feature_img3.jpg\"}}\" /></a></div>\r\n<div class=\"cat-cnt-block-right\">\r\n<div class=\"cat-cnt-block-text\">\r\n<h5>ROYAL DE VERSAILLES</h5>\r\n<h2>GLOBAL LEADER IN LUXURY<br />WATCHES &amp; JEWELLERY</h2>\r\n<p>Royal de Versailles Jewellers endeavours to be a global leader in the luxury retail experience, pioneering the promotion and appreciation of contemporary luxury watches and jewelry through our highly experienced and specialized service.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"cat-contact-bg\">\r\n<div class=\"cat-contact-bg-inner\">\r\n<div class=\"rdev-logo-black_purple\"><img alt=\"\" src=\"{{media url=\"wysiwyg/rdev-logo-black_purple.png\"}}\" /></div>\r\n<h2>VISIT US IN STORE</h2>\r\n<p>At Royal de Versailles, we are at your service to help you choose the Rolex watch that best suits you, within the wide range of Rolex timepieces. Our store located on Bloor Street, Toronto is recognized as an Official Rolex Retailer as we only sell guaranteed Rolex timepieces.</p>\r\n<div class=\"watch-contacts-btn\"><a href=\"{{store url=\"contacts\"}}\">Contact Us</a></div>\r\n</div>\r\n</div>','2017-07-07 13:10:53','2017-07-13 10:54:42',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(8,'jewellery','one_column',NULL,NULL,'jewellery','Jewellery','<p>comming soon</p>','2017-07-07 13:12:17','2017-07-07 13:12:17',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(9,'store-hours','one_column',NULL,NULL,'store-hours',NULL,'<p>comming soon</p>','2017-07-07 13:13:03','2017-07-07 13:13:03',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(10,'customer service','one_column',NULL,NULL,'customer-service','Customer service','<p>comming soon</p>','2017-07-07 13:16:23','2017-07-07 13:16:23',1,0,NULL,NULL,NULL,NULL,NULL,NULL);
